import fungi1 from "../Images/fungi1.webp";
import fungi2 from "../Images/fungi2.webp";
import fungi3 from "../Images/fungi3.webp"

const HomeCardApi = [
    {
        id:1,
        imgsrc: fungi1,
        heading: "Fungicides",
        para : "Fungicides can prevent and control all kind of diseases on crops.",
        alt: "fungi1",
        aos:"fade-down"
    },
    {
        id:2,
        imgsrc: fungi2,
        heading: "Fungicides",
        para : "Fungicides can prevent and control all kind of diseases on crops.",
        alt: "fungi2",
        aos: "fade-up"
    },
    {
        id:3,
        imgsrc: fungi3,
        heading: "Fungicides",
        para : "Fungicides can prevent and control all kind of diseases on crops.",
        alt: "fungi3",
        aos:"fade-down"
    }
]

export default HomeCardApi;
